pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective message objects
    mapping (uint256 => Message) public messages;
    // Mapping of message IDs to their respective update counts
    mapping (uint256 => uint256) public updateCounts;
    // Mapping of the owner's address to their message ID
    mapping (address => uint256) public ownerMessages;

    // Event emitted when a new message is saved
    event NewMessage(uint256 indexed messageId, string message);
    // Event emitted when a message is updated
    event MessageUpdated(uint256 indexed messageId);

    // Struct representing a message
    struct Message {
        string message;
        address owner;
    }

    // Function to save a new message
    function saveMessage(string memory _message) public {
        // Generate a unique message ID
        uint256 messageId = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender)));
        // Create a new message object
        Message memory newMessage = Message(_message, msg.sender);
        // Store the message object in the mapping
        messages[messageId] = newMessage;
        // Store the message ID in the owner's mapping
        ownerMessages[msg.sender] = messageId;
        // Emit the NewMessage event
        emit NewMessage(messageId, _message);
    }

    // Function to update a message
    function updateMessage(uint256 _messageId, string memory _newMessage) public {
        // Check if the message ID exists
        require(messages[_messageId].owner == msg.sender, "Only the owner can update the message");
        // Update the message object
        messages[_messageId].message = _newMessage;
        // Increment the update count
        updateCounts[_messageId]++;
        // Emit the MessageUpdated event
        emit MessageUpdated(_messageId);
    }

    // Function to get a message by ID
    function getMessage(uint256 _messageId) public view returns (string memory) {
        // Check if the message ID exists
        require(messages[_messageId].owner != address(0), "Message not found");
        // Return the message
        return messages[_messageId].message;
    }
}
